import*as RootModule from'../root/root.js';RootModule.Runtime.cachedResources.set("issues/descriptions/CoepCoopSandboxedIframeCannotNavigateToCoopPage.md","# An iframe navigation to a document with a Cross-Origin Opener Policy was blocked\n\nA document with a Cross-Origin Opener Policy (COOP) was blocked from loading in an iframe, because the iframe specifies a sandbox attribute.\nThis protects COOP-enabled documents from inheriting properties from its opener.\n");RootModule.Runtime.cachedResources.set("issues/descriptions/CoepCorpNotSameSite.md","# Specify a more permissive Cross-Origin Resource Policy to prevent a resource from being blocked\n\nYour site tries to access an external resource that only allows same-site usage.\nThis behavior prevents a document from loading any non-same-site resources which don’t explicitly grant permission to be loaded.\n\nTo solve this, add the following to the resource’s HTML response header: `Cross-Origin-Embedder-Policy: cross-origin`\n⚠️If you set this header, any website can embed this resource.\n");RootModule.Runtime.cachedResources.set("issues/descriptions/CoepCorpNotSameOriginAfterDefaultedToSameOriginByCoep.md","# Specify a Cross-Origin Resource Policy to prevent a resource from being blocked\n\nBecause your site has the Cross-Origin Embedder Policy (COEP) enabled, each resource must specify a suitable Cross-Origin Resource Policy (CORP).\nThis behavior prevents a document from loading cross-origin resources which don’t explicitly grant permission to be loaded.\n\nTo solve this, add the following to the resource’s response header:\n* `Cross-Origin-Resource-Policy: same-site` if the resource and your site are served from the same site.\n* `Cross-Origin-Resource-Policy: cross-origin` if the resource is served from another location than your website. ⚠️If you set this header, any website can embed this resource.\n");RootModule.Runtime.cachedResources.set("issues/descriptions/CoepCorpNotSameOrigin.md","# Specify a more permissive Cross-Origin Resource Policy to prevent a resource from being blocked\n\nYour site tries to access an external resource that only allows same-origin usage.\nThis behavior prevents a document from loading any non-same-origin resources which don’t explicitly grant permission to be loaded.\n\nTo solve this, add the following to the resource’s HTML response header:\n* `Cross-Origin-Resource-Policy: same-site` if the resource and your site are served from the same site.\n* `Cross-Origin-Resource-Policy: cross-origin` if the resource is served from another location than your website. ⚠️If you set this header, any website can embed this resource.\n");RootModule.Runtime.cachedResources.set("issues/descriptions/CoepFrameResourceNeedsCoepHeader.md","# Specify a Cross-Origin Embedder Policy to prevent this frame from being blocked\n\nBecause your site has the Cross-Origin Embedder Policy (COEP) enabled, each embedded iframe must also specify this policy.\nThis behavior protects private data from being exposed to untrusted third party sites.\n\nTo solve this, add the following to the embedded frame’s HTML response header: `Cross-Origin-Embedder-Policy: require-corp`\n");RootModule.Runtime.cachedResources.set("issues/issuesPane.css","/*\n * Copyright (c) 2020 The Chromium Authors. All rights reserved.\n * Use of this source code is governed by a BSD-style license that can be\n * found in the LICENSE file.\n */\n\n.issues-pane {\n  overflow: hidden;\n}\n\n.issues-pane-no-issues {\n  align-items: center;\n  background-color: lightgray;\n  display: flex;\n  flex: 1 1 auto;\n  font-size: 18px;\n  justify-content: center;\n  padding: 30px;\n}\n\n.issues-toolbar-container {\n  display: flex;\n  flex: none;\n}\n\n.issues-toolbar-container > .toolbar {\n  background-color: var(--toolbar-bg-color);\n  border-bottom: var(--divider-border);\n}\n\n.issues-toolbar-left {\n  flex: 1 1 auto;\n}\n\n.issues-toolbar-right {\n  padding-right: 6px;\n}\n\n/*# sourceURL=issues/issuesPane.css */")